import React, { useEffect, useState } from 'react';
import './App.css';

interface Pod {
  Name: string;
  Status: string;
  Reason: string;
}

interface K8sGPTResult {
  Summary: string;
  Details: string;
  Error: { Text: string }[];
}

function App() {
  const [pods, setPods] = useState<{ healthy: Pod[]; unhealthy: Pod[] }>({
    healthy: [],
    unhealthy: [],
  });
  const [selectedPod, setSelectedPod] = useState<Pod | null>(null);
  const [analysisResult, setAnalysisResult] = useState<K8sGPTResult | null>(null);
  const [loading, setLoading] = useState(true);
  const [analyzing, setAnalyzing] = useState(false);
  const [error, setError] = useState('');

  useEffect(() => {
    fetch('/pods')
      .then((res) => res.json())
      .then((data) => {
        if (data && Array.isArray(data.healthy) && Array.isArray(data.unhealthy)) {
          setPods(data);
        } else {
          setPods({ healthy: [], unhealthy: [] });
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error('Failed to fetch pods:', err);
        setError('Failed to fetch pod data');
        setLoading(false);
      });
  }, []);

  const analyzePod = async (pod: Pod) => {
    setSelectedPod(pod);
    setAnalyzing(true);
    setAnalysisResult(null);
    setError('');

    try {
      const response = await fetch('/analyze', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(pod),
      });

      if (!response.ok) {
        throw new Error('Failed to analyze pod');
      }

      const result = await response.json();
      setAnalysisResult(result);
    } catch (err) {
      console.error(err);
      setError('Error analyzing pod');
    } finally {
      setAnalyzing(false);
    }
  };

  return (
    <div className="App">
      <h1 className="text-2xl font-bold mb-4">Kubernetes Pod Health</h1>

      {loading ? (
        <p>Loading pods...</p>
      ) : (
        <div className="grid grid-cols-2 gap-8">
          <div>
            <h2 className="text-xl font-semibold mb-2">Healthy Pods</h2>
            <ul className="list-disc pl-5">
              {(pods?.healthy ?? []).map((pod) => (
                <li key={pod.Name}>{pod.Name}</li>
              ))}
            </ul>
          </div>

          <div>
            <h2 className="text-xl font-semibold mb-2">Unhealthy Pods</h2>
            <ul className="list-disc pl-5">
              {(pods?.unhealthy ?? []).map((pod) => (
                <li key={pod.Name} className="mb-2">
                  <p>
                    <strong>{pod.Name}</strong> - {pod.Status} - {pod.Reason}
                  </p>
                  <button
                    onClick={() => analyzePod(pod)}
                    className="mt-1 px-3 py-1 bg-blue-500 text-white rounded hover:bg-blue-600"
                    disabled={analyzing}
                  >
                    {analyzing && selectedPod?.Name === pod.Name ? 'Analyzing...' : 'Analyze'}
                  </button>
                </li>
              ))}
            </ul>
          </div>
        </div>
      )}

      {analysisResult && selectedPod && (
        <div className="mt-6 p-4 border rounded bg-gray-100">
          <h3 className="text-lg font-semibold mb-2">
            Analysis Result for <strong>{selectedPod.Name}</strong>
          </h3>
          <p><strong>Summary:</strong> {analysisResult.Summary}</p>
          {analysisResult.Details && (
            <p><strong>Details:</strong> {analysisResult.Details}</p>
          )}
          {(analysisResult.error?.length ?? 0) > 0 && (
            <ul className="list-disc pl-5 mt-2">
              {analysisResult.error.map((errItem, i) => (
                <li key={i}>{errItem.Text}</li>
              ))}
            </ul>
          )}
        </div>
      )}

      {error && (
        <p className="text-red-500 mt-4">{error}</p>
      )}
    </div>
  );
}

export default App;
